import { isNull } from "@tsparticles/engine";
export class EmittersPolygonShapeOptions {
    constructor() {
        this.angle = 0;
        this.sides = 5;
    }
    load(data) {
        if (isNull(data)) {
            return;
        }
        if (data.angle !== undefined) {
            this.angle = data.angle;
        }
        if (data.sides !== undefined) {
            this.sides = data.sides;
        }
    }
}
